    0% {
        width: 0%;
        left: 0;
        right: auto;
        opacity: 0.3;
    }
    20% {
        width: 100%;
        left: 0;
        right: auto;
        opacity: 1;
    }
    28% {
        width: 100%;
        left: auto;
        right: 0;
    }
